import React from 'react'
import Cart from './Components/Cart';
import Home from './Components/Home';
import {CartProvider} from "react-use-cart"

function App() {
  return (
    <>
      <CartProvider>
      <Home />
        <Cart />
        </CartProvider>
    </>
  );
}

export default App;
